import React from "react";
import styled from "styled-components";


const Container = styled.div`
  width: 100%;
  height: 100%;
  background-color: red;
  display: flex;
  flex-direction: column;
`;

const Block = styled.img`
  width: 100%;
  height: 100;
  background-color: yellow;
`

const HomePresenter = () => (
  <Container>
    <Block></Block>
    <Block></Block>
    <Block></Block>
    <Block></Block>

  </Container>
);

export default HomePresenter;
